def colorize_token(token:str):
    if token.isdigit():
        return f"\033[94m{token}\033[0m"  # Blue for integers
    elif re.match(r'^-?\d+\.\d+$', token):
        return f"\033[92m{token}\033[0m"  # Green for floats
    elif token.replace('_', '').isalpha():
        return f"\033[93m{token}\033[0m"  # Yellow for words
    else:
        return f"\033[97m{token}\033[0m"  # White for else

_print = print

def print_colored(*args, **kwargs):
    combined_text = ' '.join(map(str, args))
    tokens = re.findall(r'\d+\.\d+|\d+|[a-zA-Z_]+|[^\w\s]|[\s]+', combined_text)
    
    colorized_tokens = [colorize_token(token) for token in tokens]
    
    _print(''.join(colorized_tokens), **kwargs)

print = print_colored

