def run_games(runs: int, picker, debug: int = 0) -> float:
    global g_cache
    g_cache.clear()
    total_score = 0
    best_score = float("-inf")
    worst_score = float("inf")
    for run in range(runs):
        game = Game()
        x_order = X_ORDER[:]
        if debug > -1:
            print(f"Run {run+1}/{runs}")
        while 0 in game.scores.values():
            game.rollDice()
            g_cache.clear()
            rerolls = maxmax(game.dice, game, picker, 1, debug)[1]
            if debug > 3:
                print(f"Dice:       {game.dice}")
                print(f"Rerolls:    {rerolls}")

            game.rollDice(rerolls)
            if rerolls != tuple():
                rerolls = maxmax(game.dice, game, picker, 1, debug)[1]
                if debug > 3:
                    print(f"Dice:       {game.dice}")
                    print(f"Rerolls:    {rerolls}")
                game.rollDice(rerolls)
            if debug > 3:
                print("-" * 30)
            options = game.getPossibleOptions()
            if len(options) == 0:
                game.scores[x_order[0]] = None
                x_order.remove(x_order[0])
                if debug > 1:
                    print(f"Dice: {game.dice}")
                    print(f"Option: {None}")
                    print("-" * 30)
            else:
                option = picker(game, pre_options=options)
                game.scores[option] = max(options[option])
                x_order.remove(option)
                if debug > 1:
                    print(f"Dice: {game.dice}")
                    print(f"Option: {option}")
                    print(f"Score: {game.scores[option]}")
                    print("-" * 30)
        if game.calcTop() >= 63:
            game.scores["bonus"] = 50
        score = game.getScore()
        total_score += score
        best_score = max(score, best_score)
        worst_score = min(score, worst_score) 
        if debug > 0:
            if debug > 1:
                print(f"-" * 30)
            print(f"Score: {score}")
            print(f"Scores: {game.scores}")
            print(f"-" * 30)

    avg_score = total_score/ runs
    if debug > -1:
        print(f"Average score:  {avg_score}")
        print(f"Best score:     {best_score}")
        print(f"Worst score:    {worst_score}")
        print(f"-" * 30)
    return avg_score

